# 2 "Lex.fsl"
 
module FsLatte.Front.Lex
open FsLatte.Front.Par
open System
open System.Collections.Generic
open Microsoft.FSharp.Text.Lexing

let symbol_table =
    Map.ofList
        [
            ("(", LPAREN);
            (")", RPAREN);
            (",", COMMA);
            ("{", LBRACKET);
            ("}", RBRACKET);
            (";", SEMICOLON);
            ("=", SYMB7);
            ("++", SYMB8);
            ("--", SYMB9);
            ("-", SYMB10);
            ("!", SYMB11);
            ("&&", SYMB12);
            ("||", SYMB13);
            ("+", SYMB14);
            ("*", SYMB15);
            ("/", SYMB16);
            ("%", SYMB17);
            ("<", SYMB18);
            ("<=", SYMB19);
            (">", SYMB20);
            (">=", SYMB21);
            ("==", SYMB22);
            ("!=", SYMB23)
        ]

let resword_table =
    Map.ofList
        [
            ("boolean", TOK_boolean);
            ("else", TOK_else);
            ("false", TOK_false);
            ("if", TOK_if);
            ("int", TOK_int);
            ("return", TOK_return);
            ("string", TOK_string);
            ("true", TOK_true);
            ("void", TOK_void);
            ("while", TOK_while)
        ]


let unescapeInitTail (s:string) : string =
  let rec unesc s =
    match s with
    | '\\'::c::cs when List.contains c ['\"'; '\\'; '\''] -> c :: unesc cs
    | '\\'::'n'::cs  -> '\n' :: unesc cs
    | '\\'::'t'::cs  -> '\t' :: unesc cs
    | '\"'::[]    -> []
    | c::cs      -> c :: unesc cs
    | _         -> []
  s.ToCharArray() |> List.ofArray |> List.tail |> unesc |> Array.ofList |> String

let incr_lineno (lexbuf:LexBuffer<_>) : unit =
    lexbuf.EndPos <- lexbuf.EndPos.NextLine
let lexeme (lexbuf:LexBuffer<_>) : string =
    LexBuffer<_>.LexemeString lexbuf

